import React, { Component } from 'react'

export default class Beers extends Component {
  showBeers = () => {
    return this.props.allBeers.map(eachBeer => {
      return (
        <li>
          <img src={eachBeer.image_url} atl={eachBeer.name}/>
        </li>
      )
    })
  }
//   image
// name
// tagline
// contributed_by
  render() {
    return (
      <ul>
        {this.showBeers()}
      </ul>
    )
  }
}
